webpackJsonp([0xef5a5e34e335],{774:function(e,t){e.exports={data:{site:{siteMetadata:{title:"weiran.co",author:"Weiran Zhang"}},markdownRemark:{id:"/Users/weiran/git/weiran/weiran.co/src/pages/blog/2014/7/pinboard-turns-five-years-old/index.md absPath of file >>> MarkdownRemark",html:"<blockquote>\n<p>I find that the longer I run the site, the more resistant I become to the idea of ever giving it up, even if I need to take the occasional break. It is pleasant to work on something that people draw benefit from. It is especially pleasant to work on something lasting. And I enjoy the looking-glass aspect of our industry, where running a mildly profitable small business makes me a crazy maverick not afraid to break all the rules.</p>\n</blockquote>\n<p>Pinboard is the outlier, it bucks the trend, or maybe its the trend setter. I know I’ve been a very happy customer for over four years.</p>\n<p>We can learn a lot from Maciej Cegłowski.</p>",frontmatter:{title:"Pinboard turns five years old",date:"July 11, 2014",passthroughUrl:"https://blog.pinboard.in/2014/07/pinboard_turns_five/"}}},pathContext:{slug:"/blog/2014/7/pinboard-turns-five-years-old/",previous:{fields:{slug:"/blog/2014/5/why-does-apple-want-to-buy-beats/"},frontmatter:{title:"Why does Apple want to buy Beats?",passthroughUrl:null,type:null}},next:{fields:{slug:"/blog/2014/7/stickers/"},frontmatter:{title:"Stickers",passthroughUrl:null,type:null}}}}}});
